import React from "react";
import SearchBar from "./SearchBar";
import _ from "lodash";

class App extends React.Component {
  constructor() {
    super();

    this.state = {
      stocks: [],
      term: null,
      value: "",
    };
  }

  onTermSubmit = (data) => {
    let stocks = _.flattenDeep(
      Array.from(data["Time Series (Daily)"]).map((stock) => [
        {
          open: stock["1. open:"],
          high: stock["2. high:"],
          low: stock["3. low:"],
          close: stock["4. close:"],
        },
      ])
    );
    console.log(stocks);
  };

  render() {
    return (
      <div className=" ui container">
        <SearchBar onTermSubmit={this.onTermSubmit} />
      </div>
    );
  }
}

export default App;
